description:
T44 English Oak (Quercus robur - Reduce away from building to give 2m clearance, including removing epicormic growth on south side of stem up to 6m. Final height unchanged at 13m, final spread 10m. Adjacent oak, to 8m to west - reduce away from lamp post to give 2m clearance. Height unchanged at 14m, spread unchanged at 10m;
T90  Ash (Fraxinus excelsior) - Fell to ground level and remove all arisings;
T91 & T92 Black Poplar (Populus nigra) 2 x leaning trees - Fell to ground level and remove all arisings;
T76 Ash (Fraxinus excelsior) - Straight fell to ground level
